import React from "react";

function About() {
    return (
        <div class="im-pr-about">

            <div class="info-about">
                <h2>Our information is gathered from<br /> various platforms such as Reddit,<br /> Twitter and so on.</h2>
                <h3>Enter one or two concepts, and we will<br />give you the information you need.<br /> <br /> It is that easy!</h3>
            </div>

            <img src="Resources/mental-6841357.svg" alt="mentalSVG" />
        </div>
    );
}

export default About;
